import { geoNaturalEarth1 } from 'd3';

const projection = geoNaturalEarth1()
  .center([10.537004, 52.210297]) // Center over Braunschweig, Germany
  .scale(160000) // Adjust scale for zoom level; increase for more detail
  .translate([450, 300]); // Adjust based on your SVG dimensions; // Original projection


export const Marks = ({

  data,
  sizeScale,
  sizeValue,
}) => (
  <g className="marks">
    {data.map(d => {
      const [x, y] = projection(d.coords);
      return <circle             
                cx={x} 
                cy={y} 
                r={sizeScale(sizeValue(d))}
                />
                ;
    })}
  </g>

);
